INSERT INTO `exercise_descriptor_i18n` VALUES (1,'de_DE','Kann ein kurzes, eingebtes Statement verlesen, um z. B. einen Redner vorzustellen oder einen Toast auszubringen'),(1,'en_US','Can read a very short, rehearsed statement  e.g. to introduce a speaker, propose a toast'),(1,'es_ES','Es capaz de leer un comunicado breve y previamente ensayado; por ejemplo, presentar a un hablante o proponer un brindis'),(1,'fr_FR','Peut lire un texte trs bref et rpt, par exemple pour prsenter un confrencier, proposer un toast'),(2,'de_DE','Kann jemanden vorstellen und einfache Gru- und Abschiedsformeln gebrauchen'),(2,'en_US','Can make an introduction and use basic greeting and leave-taking expressions'),(2,'es_ES','Se presenta y utiliza saludos y expresiones de despedida bsicos'),(2,'fr_FR','Peut prsenter quelqu\'un et utiliser des expressions lmentaires de salutation et de cong'),(3,'de_DE','Kann jemanden nach dem Befinden fragen und auf Neuigkeiten reagieren'),(3,'en_US','Can ask how people are and react to news'),(3,'es_ES','Pregunta cmo estn las personas y expresa sus reacciones ante las noticias'),(3,'fr_FR','Peut demander  quelqu\'un de ses nouvelles et y ragir'),(4,'de_DE','Kann sich selbst beschreiben und sagen, was er/sie beruflich tut und wo er/sie wohnt'),(4,'en_US','Can describe him/herself, what he/she does and where he/she lives'),(4,'es_ES','Es capaz de describirse a s mismo, hablar de su profesin y de su lugar de residencia'),(4,'fr_FR','Peut se dcrire, dcrire ce qu\'il/elle fait, ainsi que son lieu d\'habitation'),(5,'de_DE','KANN einfache, sachliche Fragen stellen und die Antworten verstehen, soweit diese in einfacher Sprache gegeben werden (z. B. \"Wo ist der Speisesaal?\" \"Er ist im ersten Stock\" usw.)'),(5,'en_US','CAN ask simple questions of a factual nature and understand the answers provided these are expressed in simple language (for example, \'Where is the dining-room?\' \'It\'s on the first floor\', etc.)'),(5,'es_ES','PUEDE hacer preguntas sencillas, de naturaleza objetiva, y comprender las respuestas siempre que estn expresadas en lenguaje sencillo (por ej. \"Dnde est el comedor?\" \"Est en el primer piso.\", etc.)'),(5,'fr_FR','EST CAPABLE de poser des questions d\'ordre pratique et comprendre les rponses si elles sont exprimes dans un langage simple (par exemple, \"O est la salle  manger ?\" \"Elle est au premier tage\", etc.)'),(6,'de_DE','KANN einfache Beschwerden uern, z. B. \"Das Wasser ist kalt\"'),(6,'en_US','CAN make simple complaints, for example \'The water is cold\''),(6,'es_ES','PUEDE formular quejas sencillas, por ejemplo, \"El agua est fra\"'),(6,'fr_FR','EST CAPABLE de formuler des rclamations simples comme \"L\'eau est froide\"'),(7,'de_DE','KANN eine Notrufnummer anwhlen, den Ort angeben und um Hilfe bitten'),(7,'en_US','CAN call an emergency number, give location and ask for relevant service'),(7,'es_ES','PUEDE llamar por telfono a un nmero de emergencia, pedir el servicio que necesite y dar su direccin'),(7,'fr_FR','EST CAPABLE d\'appeler un numro d\'urgence, de donner l\'adresse et demander le service requis'),(8,'de_DE','Kann etwas erzhlen oder in Form einer einfachen Aufzhlung berichten'),(8,'en_US','Can tell a story or describe something in a simple list of points'),(8,'es_ES','Narra historias o describe algo mediante una relacin sencilla de elementos'),(8,'fr_FR','Peut raconter une histoire ou dcrire quelque chose par une simple liste de points'),(9,'de_DE','Kann ber Aspekte des eigenen alltglichen Lebensbereichs berichten, z. B. ber Leute, Orte, Erfahrungen in Beruf oder Ausbildung'),(9,'en_US','Can describe everyday aspects of his/her environment e.g. people, places, a job or study experience'),(9,'es_ES','Describe aspectos cotidianos de su entorno; por ejemplo, personas, lugares, una experiencia de trabajo o de estudio'),(9,'fr_FR','Peut dcrire les aspects de son environnement quotidien tels que les gens, les lieux, l\'exprience professionnelle ou scolaire'),(10,'de_DE','Kann kurz und einfach ber ein Ereignis oder eine Ttigkeit berichten'),(10,'en_US','Can give short, basic descriptions of events and activities'),(10,'es_ES','Realiza descripciones breves y bsicas de hechos y actividades'),(10,'fr_FR','Peut faire une description brve et lmentaire d\'un vnement ou d\'une activit '),(11,'de_DE','Kann Plne und Vereinbarungen, Gewohnheiten und Alltagsbeschftigungen beschreiben sowie ber vergangene Aktivitten und persnliche Erfahrungen berichten'),(11,'en_US','Can describe plans and arrangements, habits and routines, past activities and personal experiences'),(11,'es_ES','Describe planes y citas, costumbres, actividades habituales o pertenecientes al pasado y experiencias personales'),(11,'fr_FR','Peut dcrire des projets et prparatifs, des habitudes et occupations journalires, des activits passes et des expriences personnelles'),(12,'de_DE','Kann mit einfachen Mitteln Gegenstnde sowie Dinge, die ihm/ihr gehren, kurz beschreiben und vergleichen'),(12,'en_US','Can use simple descriptive language to make brief statements about and compare objects and possessions'),(12,'es_ES','Utiliza un lenguaje sencillo y descriptivo para realizar breves declaraciones sobre objetos y posesiones y para hacer comparaciones'),(12,'fr_FR','Peut dcrire et comparer brivement, dans une langue simple, des objets et choses lui appartenant'),(13,'de_DE','Kann erklren, was er/sie an etwas mag oder nicht mag'),(13,'en_US','Can explain what he/she likes or dislikes about something'),(13,'es_ES','Explica lo que le gusta y lo que no le gusta respecto a algo'),(13,'fr_FR','Peut expliquer en quoi une chose lui plait ou lui dplat'),(14,'de_DE','KANN im Restaurant die Bedienung hflich rufen und ein Essen bestellen'),(14,'en_US','CAN get the attention of staff in an appropriate way and order a meal in a restaurant'),(14,'es_ES','PUEDE conseguir la atencin de los camareros de manera apropiada y pedir une comida en un restaurante'),(14,'fr_FR','EST CAPABLE d\'attirer correctement l\'attention des serveurs et commander un repas'),(15,'de_DE','KANN einfache Fragen ber die Speisekarte stellen und einfache Antworten verstehen'),(15,'en_US','CAN ask simple questions about the menu and understand simple answers'),(15,'es_ES','PUEDE hacer preguntas sencillas sobre la carta y comprender respuestas sencillas'),(15,'fr_FR','EST CAPABLE de poser des questions simples sur le menu et comprendre des rponses simples'),(16,'de_DE','KANN seine Meinung ber das Essen uern'),(16,'en_US','CAN express an opinion about food'),(16,'es_ES','PUEDE expresar de forma muy sencilla une opinin sobre la comida'),(16,'fr_FR','EST CAPABLE d\'exprimer une opinion sur la nourriture'),(17,'de_DE','KANN einfache Beschwerden uern, z. B. \"Das Essen ist kalt\"'),(17,'en_US','CAN make simple complaints, for example, \'The food is cold\''),(17,'es_ES','PUEDE formular quejas muy simples, por ej., \"La comida est fra\"'),(17,'fr_FR','EST CAPABLE de formuler des rclamations simples comme \"Le plat est froid\"'),(18,'de_DE','KANN nach dem fragen, was er/sie mchte, wenn der Verkufer es gleich versteht'),(18,'en_US','CAN ask for what is required, if it is something which the shopkeeper can readily understand'),(18,'es_ES','PUEDE pedir lo que necesita, si es algo que el dependiente puede comprender fcilmente'),(18,'fr_FR','EST CAPABLE de demander ce qu\'il dsire s\'il s\'agit de quelque chose que le vendeur peut comprendre immdiatement'),(19,'de_DE','Kann in Geschften, Postmtern, Banken nach etwas fragen und einfache Erledigungen machen'),(19,'en_US','Can ask about things and make simple transactions in shops, post offices or banks'),(19,'es_ES','Pregunta sobrecosas y realiza transacciones sencillas en tiendas, oficinas de correo o bancos'),(19,'fr_FR','Peut poser des questions et effectuer des transactions simples dans un magasin, un bureau de poste, une banque'),(20,'de_DE','Kann Informationen ber Mengen, Anzahl, Preise usw. geben und verstehen'),(20,'en_US','Can give and receive information about quantities, numbers, prices, etc.'),(20,'es_ES','Ofrece y recibe informacin relativa a cantidades, nmeros, precios, etc.'),(20,'fr_FR','Peut demander et fournir des renseignements  propos d\'une quantit, un nombre, un prix, etc.'),(21,'de_DE','Kann einfache Einkufe machen, sagen, was er/sie sucht, und nach dem Preis fragen'),(21,'en_US','Can make simple purchases by stating what is wanted and asking the price'),(21,'es_ES','Realiza compras sencillas diciendo lo que quiere y preguntando el precio'),(21,'fr_FR','Peut faire un achat simple en indiquant ce qu\'il/elle veut et en demandant le prix'),(22,'de_DE','KANN persnlich um einen Arzttermin bitten und die Antwort verstehen'),(22,'en_US','CAN ask (face-to-face) for a medical appointment and understand the reply'),(22,'es_ES','PUEDE pedir (en persona) hora con el medico y comprender la respuesta'),(22,'fr_FR','EST CAPABLE de demander (en face  face) un rendez-vous avec le mdecin et de comprendre la rponse'),(23,'de_DE','KANN einem Arzt eine Beschwerde beschreiben, indem er/ sie mglicherweise Gestik und Krpersprache verwendet'),(23,'en_US','CAN indicate the nature of a problem to a 9 professional, perhaps using gestures and body language'),(23,'es_ES','PUEDE explicar la naturaleza de un problema a un/a profesional de la salud, apuyndose sobre todo en gestos y lenguaje corporal'),(23,'fr_FR','EST CAPABLE d\'indiquer la nature du problme  un professionnel de la sant en ayant peut tre recours aux gestes et aux mimiques'),(24,'de_DE','Kann eine eingebte, kurze, einfache Prsentation zu einem vertrauten Thema vortragen'),(24,'en_US','Can give a short, rehearsed, basic presentation on a familiar subject'),(24,'es_ES','Realiza presentaciones breves, bsicas y ensayadas que versen sobre asuntos cotidianos'),(24,'fr_FR','Peut faire un bref expos lmentaire, rpt, sur un sujet familier'),(25,'de_DE','Kann eine kurze, eingebte Prsentation zu einem Thema aus seinem/ihrem Alltag vortragen und dabei kurz Grnde und Erluterungen zu Meinungen, Plnen und Handlungen geben'),(25,'en_US','Can give a short, rehearsed presentation on a topic pertinent to his/her everyday life, briefly give reasons and explanations for opinions, plans and actions'),(25,'es_ES','Realiza presentaciones breves y ensayadas sobre temas que son de importancia en vida cotidiana y ofrece brevemente motivos y explicaciones para expresar ciertas opiniones, planes y accin'),(25,'fr_FR','Peut faire un bref expos prpar sur un sujet relatif  sa vie quotidienne, donner brivement des justifications et des explications pour ses opinions, ses projets et ses actes'),(26,'de_DE','KANN von einem Fremdenverkehrsamt Informationen erbitten und sie auch verstehen, sofern sie vertraut und nicht zu speziell sind'),(26,'en_US','CAN ask for and understand the required information from a tourist office, provided this is of a familiar, non-specialised nature'),(26,'es_ES','PUEDE pedir y comprender la informacin que necesita en une oficina de turismo, con tal de que sea de naturaleza familiar y no-especializada'),(26,'fr_FR','EST CAPABLE de demander et comprendre une information dans un bureau de tourisme si l\'information est simple et non spcialise'),(27,'de_DE','KANN einfache Erklrungen zu bekannten Orten geben'),(27,'en_US','CAN give simple explanations about familiar places'),(27,'es_ES','PUEDE dar explicaciones sencillas sobre lugares familiares'),(27,'fr_FR','EST CAPABLE de donner des explications simples concernant des lieux connus'),(28,'de_DE','Kann sozialen Kontakt herstellen durch Begrung, Abschied, Sich-Vorstellen, Danken'),(28,'en_US','Can establish social contact: greetings and farewells; introductions; giving thanks'),(28,'es_ES','Establece contacto social: saludos y despedidas; presentaciones; agradecimientos'),(28,'fr_FR','Peut tablir un contact social: salutations et cong; remerciements; prsentations'),(29,'de_DE','Kann in einfachen Worten sagen, wie es ihm/ihr geht, und Dank ausdrcken'),(29,'en_US','Can express how he/she feels in 