  CONSTRAINT `FK_user_videohistory_6` FOREIGN KEY (`fk_exercise_role_id`) REFERENCES `exercise_role` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=11915 DEFAULT CHARSET=utf8;
